    sql_table: demo.fulfillments

    joins: []

    dimensions:
      - name: id
        sql: id
        type: number
        primary_key: true

      - name: entity
        sql: entity
        type: number

      - name: shipmethod
        sql: shipmethod
        type: number

      - name: links
        sql: links
        type: string

      - name: shipcarrier
